import '../style/Authentication.css'
function Authentication () {
    async function authentication(){
        let response = await fetch('google.com');
        if (response.ok) {
        let json = await response.json();
        } else {
            alert("Ошибка HTTP: " + response.status);
        }
    }
    return (
      <div className='box'>
        <h1>Авторизация</h1>
        <input type='text' className='password' placeholder='Введите пароль' id='password'></input>
        <input type='text' className='login' placeholder='Введите логин' id='login'></input>
        <input type='button' className='button' value='Войти' onClick={authentication}></input>
      </div>
    );
  }
  
  export default Authentication ;
